// src/components/sections/Manifesto/Manifesto.jsx
import React from 'react';
import './Manifesto.scss';

const Manifesto = () => {
  return (
    <section id="manifesto" className="manifesto">
      <div className="manifesto__hero">
        <img 
          src="./Images/Zara1.jpg" 
          alt="Manifesto Hero" 
          className="manifesto__hero-image"
        />
        <div className="manifesto__hero-overlay">
          <h1>Studio Horijon</h1>
        </div>
      </div>
      
      <div className="manifesto__content">
        <h2>Manifesto</h2>
        <p>Your manifesto content goes here.</p>
      </div>
    </section>
  );
};

export default Manifesto;
